var mxUrlConverter=function(){};mxUrlConverter.prototype.enabled=true;mxUrlConverter.prototype.baseUrl=null;mxUrlConverter.prototype.baseDomain=null;mxUrlConverter.prototype.updateBaseUrl=function(){this.baseDomain=location.protocol+"//"+location.host;this.baseUrl=this.baseDomain+location.pathname;var a=this.baseUrl.lastIndexOf("/");if(a>0){this.baseUrl=this.baseUrl.substring(0,a+1)}};mxUrlConverter.prototype.isEnabled=function(){return this.enabled};mxUrlConverter.prototype.setEnabled=function(a){this.enabled=a};mxUrlConverter.prototype.getBaseUrl=function(){return this.baseUrl};mxUrlConverter.prototype.setBaseUrl=function(a){this.baseUrl=a};mxUrlConverter.prototype.getBaseDomain=function(){return this.baseDomain},mxUrlConverter.prototype.setBaseDomain=function(a){this.baseDomain=a},mxUrlConverter.prototype.isRelativeUrl=function(a){return a.substring(0,2)!="//"&&a.substring(0,7)!="http://"&&a.substring(0,8)!="https://"&&a.substring(0,10)!="data:image"};mxUrlConverter.prototype.convert=function(a){if(this.isEnabled()&&this.isRelativeUrl(a)){if(this.getBaseUrl()==null){this.updateBaseUrl()}if(a.charAt(0)=="/"){a=this.getBaseDomain()+a}else{a=this.getBaseUrl()+a}}return a};